// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import "@openzeppelin/contracts-upgradeable/token/ERC20/ERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";

contract MintableERC20 is ERC20Upgradeable, AccessControlUpgradeable {
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    address public presaleAddress;

    constructor() {
        _disableInitializers();
    }

    function initialize(
        address defaultAdmin_,
        address minter_,
        string calldata name_,
        string calldata symbol_,
        uint256 initialSupply_
    ) external initializer {
        __ERC20_init(name_, symbol_);
        __AccessControl_init();
        _grantRole(DEFAULT_ADMIN_ROLE, defaultAdmin_);
        _grantRole(MINTER_ROLE, minter_);
        _mint(defaultAdmin_, initialSupply_);
        presaleAddress = minter_;
    }

    function mint(address to, uint256 amount) public onlyRole(MINTER_ROLE) {
        _mint(to, amount);
    }
}

contracts/Presale.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "./MintableERC20.sol";

error InvalidEtherSent(uint256 amountSent, uint256 requiredAmount);
error PresaleNotActive();
error PresaleNotStarted();
error PresaleEnded();
error HardCapExceeded(uint256 currentContribution, uint256 maxContribution);
error SoftCapNotReached();
error NoTokensToClaim();
error PresaleStillActive();
error SoftCapAlreadyReached();
error InvalidSoftCapPrice();

error NoContributionToRefund();

contract Presale is OwnableUpgradeable {
    address public factoryAddress;
    MintableERC20 public token;

    uint256 public price;
    uint256 public hardCap;
    uint256 public softCap;
    uint256 public startTime;
    uint256 public endTime;
    uint256 public softCapPrice;

    uint256 public totalContributed;
    bool public softCapReached;

    mapping(address => uint256) public tokenContributions;
    mapping(address => uint256) public ethContributions;

    event NewContribution(address indexed contributor, uint256 amount);
    event EtherWithdrawn(address indexed to, uint256 amount);
    event TokenWithdrawn(address indexed to, uint256 amount);
    event TokensClaimed(address indexed claimer, uint256 amount);
    event EthRefunded(address indexed user, uint256 amount);

    constructor() {
        _disableInitializers();
    }

    function initialize(
        address owner_,
        address token_,
        uint256 price_,
        uint256 hardCap_,
        uint256 softCap_,
        uint256 startTime_,
        uint256 endTime_,
        uint256 softCapPrice_,
        address factoryAddress_
    ) external initializer {
        __Ownable_init(owner_);

        if (softCap_ > 0) {
            if (softCapPrice_ == 0) {
                revert InvalidSoftCapPrice();
            }
            if (softCapPrice_ < price_) {
                revert InvalidSoftCapPrice();
            }
        }

        factoryAddress = factoryAddress_;
        token = MintableERC20(token_);
        price = price_;
        hardCap = hardCap_;
        softCap = softCap_;
        startTime = startTime_;
        endTime = endTime_;
        softCapPrice = softCapPrice_;
    }

    function contribute(uint256 amount) external payable {
        if (block.timestamp < startTime) revert PresaleNotStarted();
        if (endTime != 0 && block.timestamp > endTime) revert PresaleEnded();

        uint256 currentPrice = price;
        if (softCapReached) {
            currentPrice = softCapPrice;
        }

        uint256 total = amount * currentPrice;

        if (total != msg.value) revert InvalidEtherSent(msg.value, total);

        if (totalContributed + msg.value > hardCap)
            revert HardCapExceeded(totalContributed, hardCap);

        totalContributed += msg.value;
        ethContributions[msg.sender] += msg.value;
        tokenContributions[msg.sender] += amount * 10 ** token.decimals();

        if (!softCapReached && totalContributed >= softCap) {
            softCapReached = true;
        }

        emit NewContribution(msg.sender, amount);
    }

    function claimTokens() external {
        if (softCap > 0 && !softCapReached) revert SoftCapNotReached();
        uint256 amountToClaim = tokenContributions[msg.sender];
        if (amountToClaim == 0) revert NoTokensToClaim();

        tokenContributions[msg.sender] = 0;
        token.mint(msg.sender, amountToClaim);

        emit TokensClaimed(msg.sender, amountToClaim);
    }

    function refund() external {
        if (block.timestamp <= endTime) revert PresaleStillActive();
        if (softCapReached) revert SoftCapAlreadyReached();
        uint256 refundAmount = ethContributions[msg.sender];
        if (refundAmount == 0) revert NoContributionToRefund();

        ethContributions[msg.sender] = 0;
        payable(msg.sender).transfer(refundAmount);

        emit EthRefunded(msg.sender, refundAmount);
    }

    function withdrawETH() external onlyOwner {
        if (softCap > 0 && !softCapReached) revert SoftCapNotReached();
        uint256 balance = address(this).balance;
        uint256 fee = balance / 100; // 1% fee
        uint256 amountToOwner = balance - fee;

        // Transfer fee to factory
        payable(factoryAddress).transfer(fee);
        // Transfer remaining amount to owner
        payable(owner()).transfer(amountToOwner);

        emit EtherWithdrawn(owner(), amountToOwner);
    }

    function withdrawToken(address token_) external onlyOwner {
        MintableERC20(token_).transfer(owner(), token.balanceOf(address(this)));

        emit TokenWithdrawn(owner(), token.balanceOf(address(this)));
    }
}

contracts/PresaleFactory.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.26;

import "@openzeppelin/contracts/proxy/Clones.sol";
import "./Presale.sol";
import "./MintableERC20.sol";

import "@openzeppelin/contracts/access/Ownable.sol";

error IncorrectPresaleCreationFee(uint256 sent, uint256 required);

contract PresaleFactory is Ownable {
    Presale public immutable presale;
    MintableERC20 public immutable token;

    uint256 public presaleCreationFee;

    address[] public allPresales;
    mapping(address => address[]) private presaleToUsers;

    event PresaleCreated(address indexed presale);

    constructor(address presale_, address token_, uint256 initialFee, address ownerAddress)
        Ownable(ownerAddress)
    {
        presale = Presale(presale_);
        token = MintableERC20(token_);
        presaleCreationFee = initialFee;
    }

    function createPresale(
        string calldata name,
        string calldata symbol,
        uint256 supply,
        uint256 price,
        uint256 hardCap,
        uint256 softCap,
        uint256 startTime,
        uint256 endTime,
        uint256 softCapPrice
    ) external payable {
        if (msg.value != presaleCreationFee) revert IncorrectPresaleCreationFee(msg.value, presaleCreationFee);
        payable(address(this)).transfer(msg.value);
        address newToken = Clones.clone(address(token));
        address newPresale = Clones.clone(address(presale));

        MintableERC20(newToken).initialize({ 
            defaultAdmin_: msg.sender,
            minter_: newPresale,
            name_: name,
            symbol_: symbol,
            initialSupply_: supply
        });
        Presale(newPresale).initialize({ 
            owner_: msg.sender,
            token_: newToken,
            price_: price,
            hardCap_: hardCap,
            softCap_: softCap,
            startTime_: startTime,
            endTime_: endTime,
            softCapPrice_: softCapPrice,
            factoryAddress_: address(this)
        });

        allPresales.push(newPresale);

        emit PresaleCreated(newPresale);
        presaleToUsers[msg.sender].push(newToken);
    }

    function getPaginatedPresales(
        uint256 page
    ) external view returns (address[] memory) {
        uint256 totalPresales = allPresales.length;
        uint256 pageSize = 10; // Fixed page size
        if (page == 0) {
            return new address[](0);
        }
        uint256 startIndex = (page - 1) * pageSize;
        if (startIndex >= totalPresales) {
            return new address[](0);
        }
        uint256 endIndex = startIndex + pageSize;
        if (endIndex > totalPresales) {
            endIndex = totalPresales;
        }
        uint256 count = endIndex - startIndex;
        address[] memory result = new address[](count);
        for (uint256 i = 0; i < count; i++) {
            result[i] = allPresales[startIndex + i];
        }
        return result;
    }

    function getUserCreatedTokens(
        address user
    ) external view returns (address[] memory) {
        return presaleToUsers[user];
    }

    function getPaginatedPresalesDecreasingByCreation(
        uint256 page,
        uint256 pageSize
    ) external view returns (address[] memory) {
        uint256 totalPresales = allPresales.length;
        if (totalPresales == 0 || page == 0) {
            return new address[](0);
        }

        uint256 skip = (page - 1) * pageSize;
        if (skip >= totalPresales) {
            return new address[](0);
        }

        uint256 countToReturn = pageSize;
        if (skip + countToReturn > totalPresales) {
            countToReturn = totalPresales - skip;
        }

        address[] memory result = new address[](countToReturn);
        for (uint256 i = 0; i < countToReturn; i++) {
            result[i] = allPresales[totalPresales - 1 - skip - i];
        }
        return result;
    }

    receive() external payable {}

    function setPresaleCreationFee(uint256 _newFee) external onlyOwner {
        presaleCreationFee = _newFee;
    }

    function getFactoryBalance() public view returns (uint256) {
        return address(this).balance;
    }

    function withdrawFees() external onlyOwner {
        uint256 balance = address(this).balance;
        payable(owner()).transfer(balance);
    }
}

